import UIKit

class StackedIconsView: UIView {

    private var iconScale: CGFloat = 0.7
    private var icons: [UIImageView] = []

    convenience init(deviceTypes: [DeviceType], context: UIViewController) {
        self.init(frame: .zero)
        // Create icons from device types
        for deviceType in deviceTypes {
            let icon = UIImageView(image: UIImage(named: deviceType.iconOutlinedImageResource))
            icons.append(icon)
            addSubview(icon)
        }
    }

    override func layoutSubviews() {
        super.layoutSubviews()
        // Position and scale icons
        for (index, icon) in icons.enumerated() {
            // Calculate icon size and position
            let newSize = CGSize(width: bounds.width * iconScale, height: bounds.height * iconScale)
            icon.transform = CGAffineTransform(scaleX: iconScale, y: iconScale)
            icon.center = CGPoint(x: bounds.width / 2, y: bounds.height / 2)
            // Add inset between icons
            if index == 1 {
                icon.center = CGPoint(x: bounds.width / 2, y: bounds.height / 2 + (bounds.height * (1 - iconScale)) / 2)
            }
        }
    }
}
