### Step-by-step analysis of the problem:
1. **Current State**: The current implementation of the `Tooltip` component uses the `useState` hook to manage its own state, which means each `Tooltip` component is isolated from the others.
2. **Problem Identification**: The problem arises when we want to close a previously opened tooltip when a new one is opened. Since each `Tooltip` component is isolated, there's no straightforward way to communicate between them.
3. **Solution Approach**: To solve this problem, we can use React Context to share state between the `Tooltip` components. We'll create a context that manages the state of the tooltips and provides a way to close the previously opened tooltip when a new one is opened.

